  `refund_shipping_code` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '退款物流单号',
  `refund_shipping_company` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '0' COMMENT '退款物流公司名称',
  `refund_real_money` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '实际退款金额',
  `refund_status` int(1) NULL DEFAULT 0 COMMENT '退款状态',
  `refund_time` int(11) NULL DEFAULT 0 COMMENT '退款时间',
  `memo` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '备注',
  `is_evaluate` smallint(6) NULL DEFAULT 0 COMMENT '是否评价 0为未评价 1为已评价 2为已追评',
  `refund_balance_money` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '订单退款余额',
  `tmp_express_company` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '批量打印时添加的临时物流公司',
  `tmp_express_company_id` int(11) NULL DEFAULT 0 COMMENT '批量打印时添加的临时物流公司id',
  `tmp_express_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '批量打印时添加的临时订单编号',
  `gift_flag` int(11) NULL DEFAULT 0 COMMENT '赠品标识，0:不是赠品，大于0：赠品id',
  `is_customer` tinyint(1) UNSIGNED NULL DEFAULT 0 COMMENT '是否售后 1:申请了售后;0:未申请',
  `is_virtual` tinyint(1) NULL DEFAULT 0 COMMENT '是否包含 虚拟商品   0 不包含  1  包含',
  `status` tinyint(4) NULL DEFAULT 1 COMMENT '状态[-1:删除;0:禁用;1启用]',
  `created_at` int(10) NULL DEFAULT 0,
  `updated_at` int(10) NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `UK_ns_order_goods_buyer_id`(`buyer_id`) USING BTREE,
  INDEX `UK_ns_order_goods_goods_id`(`product_id`) USING BTREE,
  INDEX `UK_ns_order_goods_order_id`(`order_id`) USING BTREE,
  INDEX `UK_ns_order_goods_promotion_id`(`promotion_id`) USING BTREE,
  INDEX `UK_ns_order_goods_sku_id`(`sku_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '扩展_微商城_订单商品表' ROW_FORMAT = Dynamic;

-- ----------------------------
