  `transaction_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '微信订单号',
  `total_fee` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '微信充值金额',
  `fee_type` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '标价币种',
  `pay_type` tinyint(3) NOT NULL DEFAULT 0 COMMENT '支付类型[1:微信;2:支付宝;3:银联]',
  `pay_fee` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '支付金额',
  `pay_status` tinyint(2) NULL DEFAULT 0 COMMENT '支付状态',
  `pay_time` int(10) NULL DEFAULT 0 COMMENT '支付时间',
  `trade_type` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '交易类型',
  `refund_sn` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '退款编号',
  `refund_fee` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '退款金额',
  `is_refund` tinyint(4) NULL DEFAULT 0 COMMENT '退款情况[0:未退款;1已退款]',
  `create_ip` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '创建者ip',
  `pay_ip` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '支付者ip',
  `notify_url` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '支付通知回调地址',
  `return_url` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '买家付款成功跳转地址',
  `status` tinyint(4) NULL DEFAULT 1 COMMENT '状态[-1:删除;0:禁用;1启用]',
  `created_at` int(10) NULL DEFAULT 0 COMMENT '创建时间',
  `updated_at` int(10) NULL DEFAULT 0 COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '公用_支付日志' ROW_FORMAT = Dynamic;

