-- ----------------------------
-- Table structure for rf_merchant
-- ----------------------------
DROP TABLE IF EXISTS `rf_merchant`;
CREATE TABLE `rf_merchant`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
